    private async Task ProductDelete(Product p)
    {
        using (var ctx = DbContextFactory.CreateDbContext())
        {
            ctx.Products.Remove(p);
            await ctx.SaveChangesAsync();
            products = await ctx.Products.ToListAsync();
        }
    }

